import styled from "styled-components";
const NavTitle = styled.div`
  width: 100%;
  border: 3px solid purple;
`;
const IntroContents = styled.div`
  background-color: grey;
`;

function Introduction() {
  return (
    <div className="Intro">
      <NavTitle />
      <IntroContents />
    </div>
  );
}

export default Introduction;
